CREATE TABLE `device` (
  `DeviceID` int NOT NULL AUTO_INCREMENT,
  `type` varchar(45) DEFAULT NULL,
  `Location` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`DeviceID`)
);
ALTER table device AUTO_INCREMENT = 20001;


CREATE TABLE `devicedetails` (
  `DeviceID` int NOT NULL,
  `DeviceName` varchar(80) DEFAULT NULL,
  `Manufacturer` varchar(80) DEFAULT NULL,
  `EnergyRating` varchar(4) DEFAULT NULL,
  `PowerConsumption (per Hour)` double DEFAULT NULL,
  PRIMARY KEY (`DeviceID`),
  CONSTRAINT `deviceID` FOREIGN KEY (`DeviceID`) REFERENCES `device` (`DeviceID`) ON DELETE RESTRICT ON UPDATE RESTRICT
);


CREATE TABLE `meter` (
  `meterID` int NOT NULL AUTO_INCREMENT,
  `type` varchar(45) DEFAULT NULL,
  `location` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`meterID`)
);

CREATE TABLE `usages` (
  `userID` int NOT NULL,
  `deviceID` int NOT NULL,
  `meterID` int NOT NULL,
  `date` date NOT NULL,
  `usageAmount` float DEFAULT NULL,
  PRIMARY KEY (`userID`,`deviceID`,`meterID`,`date`),
  KEY `meterID_idx` (`meterID`),
  KEY `deviceIDD_idx` (`deviceID`),
  CONSTRAINT `deviceIDD` FOREIGN KEY (`deviceID`) REFERENCES `device` (`DeviceID`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `meterID` FOREIGN KEY (`meterID`) REFERENCES `meter` (`meterID`),
  CONSTRAINT `userID` FOREIGN KEY (`userID`) REFERENCES `users` (`ID`)
);



DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `ID` int NOT NULL AUTO_INCREMENT,
  `Fname` varchar(20) NOT NULL,
  `Lname` varchar(20) DEFAULT NULL,
  `UserName` varchar(25) NOT NULL,
  `Password` varchar(60) NOT NULL,
  `Street` varchar(30) NOT NULL,
  `City` varchar(20) NOT NULL,
  `State` varchar(20) NOT NULL,
  `Pincode` varchar(8) NOT NULL,
  `Phoneno` varchar(13) NOT NULL,
  `Email` varchar(45) NOT NULL,
  `UserType` int NOT NULL DEFAULT '0',
  PRIMARY KEY (`ID`)
);
ALTER TABLE users AUTO_INCREMENT = 10001;


CREATE TABLE `usersdevices` (
  `UserID` int NOT NULL,
  `DeviceID` int NOT NULL,
  `MeterID` int NOT NULL,
  PRIMARY KEY (`UserID`,`DeviceID`,`MeterID`),
  KEY `MeterNoo_idx` (`MeterID`),
  KEY `deviceIDDD_idx` (`DeviceID`),
  CONSTRAINT `deviceIDDD` FOREIGN KEY (`DeviceID`) REFERENCES `device` (`DeviceID`),
  CONSTRAINT `MeterNoo` FOREIGN KEY (`MeterID`) REFERENCES `meter` (`meterID`),
  CONSTRAINT `UserNO` FOREIGN KEY (`UserID`) REFERENCES `users` (`ID`)
);

CREATE TABLE `usersmeters` (
  `UserID` int NOT NULL,
  `MeterID` int NOT NULL,
  PRIMARY KEY (`UserID`,`MeterID`),
  KEY `MeterIDDD_idx` (`MeterID`),
  CONSTRAINT `MeterIDDD` FOREIGN KEY (`MeterID`) REFERENCES `meter` (`meterID`),
  CONSTRAINT `UserIDD` FOREIGN KEY (`UserID`) REFERENCES `users` (`ID`)
);
